import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props){
    super(props);
    console.log("This is my console.log")

    const movies = [
      {id:0, poster_src:"kqjL17yufvn9OVLyXYpvtyrFfak.jpg", title: "Avengers:Infinity War",overview: "test test"},
      {id:1, title: "The Avengers",overview: "test test2"},
    ]

    var movieRows = []
    movies.forEach(movies => {
      console.log(movies.title)
      const movieRow = <table key={movies.id}>
        <tbody>
          <tr>
            <td>
              <img alt="poster" src= ""/>
            </td>
            <td>
              {movies.title}
            </td>
          </tr>
        </tbody>
      </table>
      movieRows.push(movieRow)
    })

    this.state = {rows: movieRows}
  }
  render() {
    return (
      <div className="App">
      <table className="titleBar">
        <tbody>
          <tr>
            <td>
              <img alt="app icon" width="50" src="logo.png"/>
            </td>
            <td>
              <h1>MoviesDB Search</h1>
            </td>
          </tr>
        </tbody>
      </table>

      <input className="inputSearch" placeholder="Enter movie search term"></input>

      {this.state.rows}

      </div>
    );
  }
}

export default App;
